            </li>
            <li><a class="dropdown-item" href="#">Something else here</a></li>
          </ul>
        </li>
        <li class="nav-item">
          <a class="nav-link disabled"  aria-disabled="true">Disabled</a>
        </li>
      </ul>
      <form class="d-flex" role="search">
        <input class="form-control me-2" type="search" name="name" placeholder="Search" aria-label="Search" [(ngModel)]="name">
        <button class="btn btn-outline-success" type="submit" (click)="save()">Search</button>
      </form>
    </div>

  </div>
</nav><br>
